let state = {
  profilePage: {
    postData: [
      { message: "hi", id: 1, likes: "15" },
      { message: "how is your name", id: 1, likes: "15" },
      { message: "what are you doing", id: 1, likes: "15" },
    ],
  },

  dialogsPage: {
    dialogsData: [
      { id: 1, name: "Eugene", img:'https://i.pinimg.com/originals/4a/61/88/4a6188d83bf311374d56fba066c25d28.png' },
      { id: 2, name: "Sasha" },
      { id: 3, name: "Igor" },
      { id: 4, name: "lex" },
      { id: 5, name: "Ilya" },
    ],
    messageData: [
      { say: "hi", id: 1 },
      { say: "how is your name", id: 2 },
      { say: "what are you doing", id: 3 },
      { say: "how old are you", id: 3 },
      { say: "what are you doing", id: 3 },
      { say: "what are you doing", id: 3 },
    ],
  },
};

export default state;
